import React, { Component } from 'react'
import '../css/navbar.css'

export default class Navbar extends Component {
    constructor(props) {
        super(props)
        this.state = {
            active: "sorting"
        }
    }

    render() {
        return ( 
        <div className="navbar">
            <div className={`nav-item ${this.state.active==="sorting" ? "active" : ""}`} id="sorting">Sorting</div>
            <div className={`nav-item ${this.state.active==="graphs" ? "active" : ""}`} id="graphs">Graphs</div>
            <div className={`nav-item ${this.state.active==="path-finding" ? "active" : ""}`} id="path-finding">Path Finding</div>
        </div>
        )
    }
}
